description:
Twenty-four million years ago, Megalodon was a 20 tonne killing machine with a 10 foot gaping bite. When two researchers discover a colossal shark&amp;#039;s tooth off the Mexican coast their worst fears surface - the most menacing beast to ever rule the waters is still alive and mercilessly feeding on anything that crosses its path. Now they must hunt the fierce killer and destroy it... before there is no one left to stop its reign of terror!
